function Product (props) {
    return (
      <div>
        <div style={{backgroundImage: `url(${props.image})`}}></div>
        <div>
          <h1>{props.title.substr(0, 50)}</h1>
          <h3>{props.category}</h3>
          <p>{props.price}$</p>
          <div>{props.description.substr(0, 100)}</div>
        </div>
      </div>
    );
  }

  export default Product;
